export const totalAmount = (loan_amount, product_interest) => {
  return (
    parseInt(loan_amount) + parseInt(loan_amount) * parseInt(product_interest)
  );
};

export const monthlyInstallment = (
  loan_amount,
  num_of_months,
  product_interest
) => {
  return totalAmount(loan_amount, product_interest) / parseInt(num_of_months);
};

export const targetMonth = (current_month, num_of_months) => {
  return current_month + num_of_months;
};
